import React from "react";
import "./Header.css";
class Header extends React.Component {
  render() {
    return (
      <div>
        <br />
        <br />
        <h1 align="center" className="header-h1">
          Remote Embedded Lab
        </h1>
      </div>
    );
  }
}

export default Header;
